$(()=>{let{couponid:o}=function(o){var t=o.split("?")[1];if(!t)return!1;var n=t.split("&");if(!n)return!1;for(var c={},i=0;i<n.length;i++){var r=n[i].split("=");c[r[0]]=r[1]}return c}(window.location.href);$.ajax({url:"http://127.0.0.1:3000/api/getcouponproduct",dataType:"json",data:{couponid:o},success:o=>{let t=o.result,n="";t.forEach(o=>{n+=`\n                <li><a title="${o.couponProductName}">\n                        <div class="pic">\n                        <img src="${o.couponProductImg.src}"\n                                alt="${o.couponProductImg.alt}"></div>\n                        <div class="info">\n                            <div class="tit">\n                                <h3>${o.couponProductName}</h3>\n                                <h2>${o.couponProductPrice}</h2>\n                            </div>\n                            <div class="time">${o.couponProductTime}</div>\n                        </div>\n                    </a></li>`}),$(".coupon-list ul").html(n)}})});